import React from 'react'
import "./ImageSearch.css"
export default function ImageSearch(props) {
    return (
        <div>
                <form onSubmit={props.handleSubmit}>
                            <input type='text' placeholder='Search Value..' name='searchValue' />
                            <button>Search</button>
                </form>
               
        </div>
    )
}
